import Order from './Order'

const PrevOrders = ({orders}) => {
    return (
        <div>
            <h2>Previous Orders</h2>
            {orders.map(order => 
                <Order key={order.id} order={order}/>    
            )}
        </div>
    )
}

export default PrevOrders
